import CountUI from '../../components/Count'

import {connect} from 'react-redux'

const CountContainer = connect(a,b)(CountUI)

export default CountContainer

function a (){
    // 函数a的返回值是向子组件 Components中的Count传递内容的方式
    return {count:1}
}

function b (){
    console.log('%');
}
